import  React, {useState, useEffect} from "react"
import Box from "./Box"

function App(props){
    const [fruit, setFruit] = useState("apple");

    const handleClick = () => {
        console.log("You done been clicked", )
    }

    useEffect(() => {
        console.log("THIS IS ONLY THE BEGINNING")
    },[])

    useEffect(() => {
        console.log("something happened")
    })

    return (
        <>
            <div> Hey there</div>
            <Box value={7} fruit={fruit} handleClick = {handleClick}/>
            <Box fruit={fruit}/>
            <Box value={2} />
        </>   
    )
}

export default App;
